CREATE TABLE articles_tableka (ID NUMBER PRIMARY KEY, Title VARCHAR2(255), Year NUMBER, Authors NUMBER, Points NUMBER);
CREATE TABLE authorship_tableka (Article_ID NUMBER, Author VARCHAR2(255), ID NUMBER PRIMARY KEY);
CREATE TABLE authors_tableka (Author VARCHAR2(255) PRIMARY KEY, Risk NUMBER, Slots VARCHAR(5));
select distinct A.Author as ryzykowny_autor, B.Author as pomocniczy_autor from authorship_tableka A join authorship_tableka B on A.Article_ID = B.Article_ID where A.Author <> B.Author and A.Author in (select Author from authors_tableka where Risk = 1 and Author not in (select Author from authorship_tableka where Article_ID in (select ID from articles_tableka where Year = 2020))) order by A.Author;

